searchData={"items":[{"type":"module","title":"ElixirT1","doc":"ElixirT1 keeps the contexts that define your domain\nand business logic.\n\nContexts are also responsible for managing your data, regardless\nif it comes from the database, an external API or others.","ref":"ElixirT1.html"},{"type":"module","title":"ElixirT1.Mailer","doc":"","ref":"ElixirT1.Mailer.html"},{"type":"function","title":"ElixirT1.Mailer.deliver/2","doc":"Delivers an email.\n\nIf the email is delivered it returns an `{:ok, result}` tuple. If it fails,\nreturns an `{:error, error}` tuple.","ref":"ElixirT1.Mailer.html#deliver/2"},{"type":"function","title":"ElixirT1.Mailer.deliver!/2","doc":"Delivers an email, raises on error.\n\nIf the email is delivered, it returns the result. If it fails, it raises\na `DeliveryError`.","ref":"ElixirT1.Mailer.html#deliver!/2"},{"type":"function","title":"ElixirT1.Mailer.deliver_many/2","doc":"Delivers a list of emails.\n\nIt accepts a list of `%Swoosh.Email{}` as its first parameter.","ref":"ElixirT1.Mailer.html#deliver_many/2"},{"type":"module","title":"ElixirT1Web","doc":"The entrypoint for defining your web interface, such\nas controllers, components, channels, and so on.\n\nThis can be used in your application as:\n\n    use ElixirT1Web, :controller\n    use ElixirT1Web, :html\n\nThe definitions below will be executed for every controller,\ncomponent, etc, so keep them short and clean, focused\non imports, uses and aliases.\n\nDo NOT define functions inside the quoted expressions\nbelow. Instead, define additional modules and import\nthose modules here.","ref":"ElixirT1Web.html"},{"type":"macro","title":"ElixirT1Web.__using__/1","doc":"When used, dispatch to the appropriate controller/live_view/etc.","ref":"ElixirT1Web.html#__using__/1"},{"type":"function","title":"ElixirT1Web.channel/0","doc":"","ref":"ElixirT1Web.html#channel/0"},{"type":"function","title":"ElixirT1Web.controller/0","doc":"","ref":"ElixirT1Web.html#controller/0"},{"type":"function","title":"ElixirT1Web.html/0","doc":"","ref":"ElixirT1Web.html#html/0"},{"type":"function","title":"ElixirT1Web.live_component/0","doc":"","ref":"ElixirT1Web.html#live_component/0"},{"type":"function","title":"ElixirT1Web.live_view/0","doc":"","ref":"ElixirT1Web.html#live_view/0"},{"type":"function","title":"ElixirT1Web.router/0","doc":"","ref":"ElixirT1Web.html#router/0"},{"type":"function","title":"ElixirT1Web.static_paths/0","doc":"","ref":"ElixirT1Web.html#static_paths/0"},{"type":"function","title":"ElixirT1Web.verified_routes/0","doc":"","ref":"ElixirT1Web.html#verified_routes/0"},{"type":"module","title":"ElixirT1Web.CoreComponents","doc":"Provides core UI components.\n\nAt first glance, this module may seem daunting, but its goal is to provide\ncore building blocks for your application, such as tables, forms, and\ninputs. The components consist mostly of markup and are well-documented\nwith doc strings and declarative assigns. You may customize and style\nthem in any way you want, based on your application growth and needs.\n\nThe foundation for styling is Tailwind CSS, a utility-first CSS framework,\naugmented with daisyUI, a Tailwind CSS plugin that provides UI components\nand themes. Here are useful references:\n\n  * [daisyUI](https://daisyui.com/docs/intro/) - a good place to get\n    started and see the available components.\n\n  * [Tailwind CSS](https://tailwindcss.com) - the foundational framework\n    we build on. You will use it for layout, sizing, flexbox, grid, and\n    spacing.\n\n  * [Heroicons](https://heroicons.com) - see `icon/1` for usage.\n\n  * [Phoenix.Component](https://hexdocs.pm/phoenix_live_view/Phoenix.Component.html) -\n    the component system used by Phoenix. Some components, such as `<.link>`\n    and `<.form>`, are defined there.","ref":"ElixirT1Web.CoreComponents.html"},{"type":"function","title":"ElixirT1Web.CoreComponents.button/1","doc":"Renders a button with navigation support.","ref":"ElixirT1Web.CoreComponents.html#button/1"},{"type":"function","title":"Examples - ElixirT1Web.CoreComponents.button/1","doc":"<.button>Send!</.button>\n    <.button phx-click=\"go\" variant=\"primary\">Send!</.button>\n    <.button navigate={~p\"/\"}>Home</.button>","ref":"ElixirT1Web.CoreComponents.html#button/1-examples"},{"type":"function","title":"Attributes - ElixirT1Web.CoreComponents.button/1","doc":"* `class` (`:any`)\n* `variant` (`:string`) - Must be one of `\"primary\"`.\n* Global attributes are accepted. Supports all globals plus: `[\"href\", \"navigate\", \"patch\", \"method\", \"download\", \"name\", \"value\", \"disabled\"]`.","ref":"ElixirT1Web.CoreComponents.html#button/1-attributes"},{"type":"function","title":"Slots - ElixirT1Web.CoreComponents.button/1","doc":"* `inner_block` (required)","ref":"ElixirT1Web.CoreComponents.html#button/1-slots"},{"type":"function","title":"ElixirT1Web.CoreComponents.flash/1","doc":"Renders flash notices.","ref":"ElixirT1Web.CoreComponents.html#flash/1"},{"type":"function","title":"Examples - ElixirT1Web.CoreComponents.flash/1","doc":"<.flash kind={:info} flash={@flash} />\n    <.flash kind={:info} phx-mounted={show(\"#flash\")}>Welcome Back!</.flash>","ref":"ElixirT1Web.CoreComponents.html#flash/1-examples"},{"type":"function","title":"Attributes - ElixirT1Web.CoreComponents.flash/1","doc":"* `id` (`:string`) - the optional id of flash container.\n* `flash` (`:map`) - the map of flash messages to display. Defaults to `%{}`.\n* `title` (`:string`) - Defaults to `nil`.\n* `kind` (`:atom`) - used for styling and flash lookup. Must be one of `:info`, or `:error`.\n* Global attributes are accepted. the arbitrary HTML attributes to add to the flash container.","ref":"ElixirT1Web.CoreComponents.html#flash/1-attributes"},{"type":"function","title":"Slots - ElixirT1Web.CoreComponents.flash/1","doc":"* `inner_block` - the optional inner block that renders the flash message.","ref":"ElixirT1Web.CoreComponents.html#flash/1-slots"},{"type":"function","title":"ElixirT1Web.CoreComponents.header/1","doc":"Renders a header with title.","ref":"ElixirT1Web.CoreComponents.html#header/1"},{"type":"function","title":"Slots - ElixirT1Web.CoreComponents.header/1","doc":"* `inner_block` (required)\n* `subtitle`\n* `actions`","ref":"ElixirT1Web.CoreComponents.html#header/1-slots"},{"type":"function","title":"ElixirT1Web.CoreComponents.hide/2","doc":"","ref":"ElixirT1Web.CoreComponents.html#hide/2"},{"type":"function","title":"ElixirT1Web.CoreComponents.icon/1","doc":"Renders a [Heroicon](https://heroicons.com).\n\nHeroicons come in three styles â€“ outline, solid, and mini.\nBy default, the outline style is used, but solid and mini may\nbe applied by using the `-solid` and `-mini` suffix.\n\nYou can customize the size and colors of the icons by setting\nwidth, height, and background color classes.\n\nIcons are extracted from the `deps/heroicons` directory and bundled within\nyour compiled app.css by the plugin in `assets/vendor/heroicons.js`.","ref":"ElixirT1Web.CoreComponents.html#icon/1"},{"type":"function","title":"Examples - ElixirT1Web.CoreComponents.icon/1","doc":"<.icon name=\"hero-x-mark\" />\n    <.icon name=\"hero-arrow-path\" class=\"ml-1 size-3 motion-safe:animate-spin\" />","ref":"ElixirT1Web.CoreComponents.html#icon/1-examples"},{"type":"function","title":"Attributes - ElixirT1Web.CoreComponents.icon/1","doc":"* `name` (`:string`) (required)\n* `class` (`:any`) - Defaults to `\"size-4\"`.","ref":"ElixirT1Web.CoreComponents.html#icon/1-attributes"},{"type":"function","title":"ElixirT1Web.CoreComponents.input/1","doc":"Renders an input with label and error messages.\n\nA `Phoenix.HTML.FormField` may be passed as argument,\nwhich is used to retrieve the input name, id, and values.\nOtherwise all attributes may be passed explicitly.","ref":"ElixirT1Web.CoreComponents.html#input/1"},{"type":"function","title":"Types - ElixirT1Web.CoreComponents.input/1","doc":"This function accepts all HTML input types, considering that:\n\n  * You may also set `type=\"select\"` to render a ` ` tag\n\n  * `type=\"checkbox\"` is used exclusively to render boolean values\n\n  * For live file uploads, see `Phoenix.Component.live_file_input/1`\n\nSee https://developer.mozilla.org/en-US/docs/Web/HTML/Element/input\nfor more information. Unsupported types, such as radio, are best\nwritten directly in your templates.","ref":"ElixirT1Web.CoreComponents.html#input/1-types"},{"type":"function","title":"Examples - ElixirT1Web.CoreComponents.input/1","doc":"```heex\n<.input field={@form[:email]} type=\"email\" />\n<.input name=\"my-input\" errors={[\"oh no!\"]} />\n```","ref":"ElixirT1Web.CoreComponents.html#input/1-examples"},{"type":"function","title":"Select type - ElixirT1Web.CoreComponents.input/1","doc":"When using `type=\"select\"`, you must pass the `options` and optionally\na `value` to mark which option should be preselected.\n\n```heex\n<.input field={@form[:user_type]} type=\"select\" options={[\"Admin\": \"admin\", \"User\": \"user\"]} />\n```\n\nFor more information on what kind of data can be passed to `options` see\n[`options_for_select`](https://hexdocs.pm/phoenix_html/Phoenix.HTML.Form.html#options_for_select/2).","ref":"ElixirT1Web.CoreComponents.html#input/1-select-type"},{"type":"function","title":"Attributes - ElixirT1Web.CoreComponents.input/1","doc":"* `id` (`:any`) - Defaults to `nil`.\n* `name` (`:any`)\n* `label` (`:string`) - Defaults to `nil`.\n* `value` (`:any`)\n* `type` (`:string`) - Defaults to `\"text\"`. Must be one of `\"checkbox\"`, `\"color\"`, `\"date\"`, `\"datetime-local\"`, `\"email\"`, `\"file\"`, `\"month\"`, `\"number\"`, `\"password\"`, `\"search\"`, `\"select\"`, `\"tel\"`, `\"text\"`, `\"textarea\"`, `\"time\"`, `\"url\"`, `\"week\"`, or `\"hidden\"`.\n* `field` (`Phoenix.HTML.FormField`) - a form field struct retrieved from the form, for example: @form[:email].\n* `errors` (`:list`) - Defaults to `[]`.\n* `checked` (`:boolean`) - the checked flag for checkbox inputs.\n* `prompt` (`:string`) - the prompt for select inputs. Defaults to `nil`.\n* `options` (`:list`) - the options to pass to Phoenix.HTML.Form.options_for_select/2.\n* `multiple` (`:boolean`) - the multiple flag for select inputs. Defaults to `false`.\n* `class` (`:any`) - the input class to use over defaults. Defaults to `nil`.\n* `error_class` (`:any`) - the input error class to use over defaults. Defaults to `nil`.\n* Global attributes are accepted. Supports all globals plus: `[\"accept\", \"autocomplete\", \"capture\", \"cols\", \"disabled\", \"form\", \"list\", \"max\", \"maxlength\", \"min\", \"minlength\", \"multiple\", \"pattern\", \"placeholder\", \"readonly\", \"required\", \"rows\", \"size\", \"step\"]`.","ref":"ElixirT1Web.CoreComponents.html#input/1-attributes"},{"type":"function","title":"ElixirT1Web.CoreComponents.list/1","doc":"Renders a data list.","ref":"ElixirT1Web.CoreComponents.html#list/1"},{"type":"function","title":"Examples - ElixirT1Web.CoreComponents.list/1","doc":"<.list>\n      <:item title=\"Title\">{@post.title}</:item>\n      <:item title=\"Views\">{@post.views}</:item>\n    </.list>","ref":"ElixirT1Web.CoreComponents.html#list/1-examples"},{"type":"function","title":"Slots - ElixirT1Web.CoreComponents.list/1","doc":"* `item` (required) - Accepts attributes:\n\n  * `title` (`:string`) (required)","ref":"ElixirT1Web.CoreComponents.html#list/1-slots"},{"type":"function","title":"ElixirT1Web.CoreComponents.show/2","doc":"","ref":"ElixirT1Web.CoreComponents.html#show/2"},{"type":"function","title":"ElixirT1Web.CoreComponents.table/1","doc":"Renders a table with generic styling.","ref":"ElixirT1Web.CoreComponents.html#table/1"},{"type":"function","title":"Examples - ElixirT1Web.CoreComponents.table/1","doc":"<.table id=\"users\" rows={@users}>\n      <:col :let={user} label=\"id\">{user.id}</:col>\n      <:col :let={user} label=\"username\">{user.username}</:col>\n    </.table>","ref":"ElixirT1Web.CoreComponents.html#table/1-examples"},{"type":"function","title":"Attributes - ElixirT1Web.CoreComponents.table/1","doc":"* `id` (`:string`) (required)\n* `rows` (`:list`) (required)\n* `row_id` (`:any`) - the function for generating the row id. Defaults to `nil`.\n* `row_click` (`:any`) - the function for handling phx-click on each row. Defaults to `nil`.\n* `row_item` (`:any`) - the function for mapping each row before calling the :col and :action slots. Defaults to `&Function.identity/1`.","ref":"ElixirT1Web.CoreComponents.html#table/1-attributes"},{"type":"function","title":"Slots - ElixirT1Web.CoreComponents.table/1","doc":"* `col` (required) - Accepts attributes:\n\n  * `label` (`:string`)\n* `action` - the slot for showing user actions in the last table column.","ref":"ElixirT1Web.CoreComponents.html#table/1-slots"},{"type":"function","title":"ElixirT1Web.CoreComponents.translate_error/1","doc":"Translates an error message using gettext.","ref":"ElixirT1Web.CoreComponents.html#translate_error/1"},{"type":"function","title":"ElixirT1Web.CoreComponents.translate_errors/2","doc":"Translates the errors for a field from a keyword list of errors.","ref":"ElixirT1Web.CoreComponents.html#translate_errors/2"},{"type":"module","title":"ElixirT1Web.Endpoint","doc":"","ref":"ElixirT1Web.Endpoint.html"},{"type":"function","title":"ElixirT1Web.Endpoint.broadcast/3","doc":"Callback implementation for  Phoenix.Endpoint.broadcast/3 .","ref":"ElixirT1Web.Endpoint.html#broadcast/3"},{"type":"function","title":"ElixirT1Web.Endpoint.broadcast!/3","doc":"Callback implementation for  Phoenix.Endpoint.broadcast!/3 .","ref":"ElixirT1Web.Endpoint.html#broadcast!/3"},{"type":"function","title":"ElixirT1Web.Endpoint.broadcast_from/4","doc":"Callback implementation for  Phoenix.Endpoint.broadcast_from/4 .","ref":"ElixirT1Web.Endpoint.html#broadcast_from/4"},{"type":"function","title":"ElixirT1Web.Endpoint.broadcast_from!/4","doc":"Callback implementation for  Phoenix.Endpoint.broadcast_from!/4 .","ref":"ElixirT1Web.Endpoint.html#broadcast_from!/4"},{"type":"function","title":"ElixirT1Web.Endpoint.call/2","doc":"Callback implementation for  Plug.call/2 .","ref":"ElixirT1Web.Endpoint.html#call/2"},{"type":"function","title":"ElixirT1Web.Endpoint.child_spec/1","doc":"Returns the child specification to start the endpoint\nunder a supervision tree.","ref":"ElixirT1Web.Endpoint.html#child_spec/1"},{"type":"function","title":"ElixirT1Web.Endpoint.config/2","doc":"Returns the endpoint configuration for `key`\n\nReturns `default` if the key does not exist.","ref":"ElixirT1Web.Endpoint.html#config/2"},{"type":"function","title":"ElixirT1Web.Endpoint.config_change/2","doc":"Reloads the configuration given the application environment changes.","ref":"ElixirT1Web.Endpoint.html#config_change/2"},{"type":"function","title":"ElixirT1Web.Endpoint.host/0","doc":"Returns the host for the given endpoint.","ref":"ElixirT1Web.Endpoint.html#host/0"},{"type":"function","title":"ElixirT1Web.Endpoint.init/1","doc":"Callback implementation for  Plug.init/1 .","ref":"ElixirT1Web.Endpoint.html#init/1"},{"type":"function","title":"ElixirT1Web.Endpoint.local_broadcast/3","doc":"Callback implementation for  Phoenix.Endpoint.local_broadcast/3 .","ref":"ElixirT1Web.Endpoint.html#local_broadcast/3"},{"type":"function","title":"ElixirT1Web.Endpoint.local_broadcast_from/4","doc":"Callback implementation for  Phoenix.Endpoint.local_broadcast_from/4 .","ref":"ElixirT1Web.Endpoint.html#local_broadcast_from/4"},{"type":"function","title":"ElixirT1Web.Endpoint.path/1","doc":"Generates the path information when routing to this endpoint.","ref":"ElixirT1Web.Endpoint.html#path/1"},{"type":"function","title":"ElixirT1Web.Endpoint.script_name/0","doc":"Generates the script name.","ref":"ElixirT1Web.Endpoint.html#script_name/0"},{"type":"function","title":"ElixirT1Web.Endpoint.server_info/1","doc":"Returns the address and port that the server is running on","ref":"ElixirT1Web.Endpoint.html#server_info/1"},{"type":"function","title":"ElixirT1Web.Endpoint.start_link/1","doc":"Starts the endpoint supervision tree.\n\nAll other options are merged into the endpoint configuration.","ref":"ElixirT1Web.Endpoint.html#start_link/1"},{"type":"function","title":"ElixirT1Web.Endpoint.static_integrity/1","doc":"Generates a base64-encoded cryptographic hash (sha512) to a static file\nin `priv/static`. Meant to be used for Subresource Integrity with CDNs.","ref":"ElixirT1Web.Endpoint.html#static_integrity/1"},{"type":"function","title":"ElixirT1Web.Endpoint.static_lookup/1","doc":"Returns a two item tuple with the first item being the `static_path`\nand the second item being the `static_integrity`.","ref":"ElixirT1Web.Endpoint.html#static_lookup/1"},{"type":"function","title":"ElixirT1Web.Endpoint.static_path/1","doc":"Generates a route to a static file in `priv/static`.","ref":"ElixirT1Web.Endpoint.html#static_path/1"},{"type":"function","title":"ElixirT1Web.Endpoint.static_url/0","doc":"Generates the static URL without any path information.\n\nIt uses the configuration under `:static_url` to generate\nsuch. It falls back to `:url` if `:static_url` is not set.","ref":"ElixirT1Web.Endpoint.html#static_url/0"},{"type":"function","title":"ElixirT1Web.Endpoint.struct_url/0","doc":"Generates the endpoint base URL but as a `URI` struct.\n\nIt uses the configuration under `:url` to generate such.\nUseful for manipulating the URL data and passing it to\nURL helpers.","ref":"ElixirT1Web.Endpoint.html#struct_url/0"},{"type":"function","title":"ElixirT1Web.Endpoint.subscribe/2","doc":"Callback implementation for  Phoenix.Endpoint.subscribe/2 .","ref":"ElixirT1Web.Endpoint.html#subscribe/2"},{"type":"function","title":"ElixirT1Web.Endpoint.unsubscribe/1","doc":"Callback implementation for  Phoenix.Endpoint.unsubscribe/1 .","ref":"ElixirT1Web.Endpoint.html#unsubscribe/1"},{"type":"function","title":"ElixirT1Web.Endpoint.url/0","doc":"Generates the endpoint base URL without any path information.\n\nIt uses the configuration under `:url` to generate such.","ref":"ElixirT1Web.Endpoint.html#url/0"},{"type":"module","title":"ElixirT1Web.ErrorHTML","doc":"This module is invoked by your endpoint in case of errors on HTML requests.\n\nSee config/config.exs.","ref":"ElixirT1Web.ErrorHTML.html"},{"type":"function","title":"ElixirT1Web.ErrorHTML.render/2","doc":"","ref":"ElixirT1Web.ErrorHTML.html#render/2"},{"type":"module","title":"ElixirT1Web.ErrorJSON","doc":"This module is invoked by your endpoint in case of errors on JSON requests.\n\nSee config/config.exs.","ref":"ElixirT1Web.ErrorJSON.html"},{"type":"function","title":"ElixirT1Web.ErrorJSON.render/2","doc":"","ref":"ElixirT1Web.ErrorJSON.html#render/2"},{"type":"module","title":"ElixirT1Web.Gettext","doc":"A module providing Internationalization with a gettext-based API.\n\nBy using [Gettext](https://hexdocs.pm/gettext), your module compiles translations\nthat you can use in your application. To use this Gettext backend module,\ncall `use Gettext` and pass it as an option:\n\n    use Gettext, backend: ElixirT1Web.Gettext\n\n    # Simple translation\n    gettext(\"Here is the string to translate\")\n\n    # Plural translation\n    ngettext(\"Here is the string to translate\",\n             \"Here are the strings to translate\",\n             3)\n\n    # Domain-based translation\n    dgettext(\"errors\", \"Here is the error message to translate\")\n\nSee the [Gettext Docs](https://hexdocs.pm/gettext) for detailed usage.","ref":"ElixirT1Web.Gettext.html"},{"type":"function","title":"ElixirT1Web.Gettext.handle_missing_bindings/2","doc":"Callback implementation for  Gettext.Backend.handle_missing_bindings/2 .","ref":"ElixirT1Web.Gettext.html#handle_missing_bindings/2"},{"type":"function","title":"ElixirT1Web.Gettext.handle_missing_plural_translation/7","doc":"Callback implementation for  Gettext.Backend.handle_missing_plural_translation/7 .","ref":"ElixirT1Web.Gettext.html#handle_missing_plural_translation/7"},{"type":"function","title":"ElixirT1Web.Gettext.handle_missing_translation/5","doc":"Callback implementation for  Gettext.Backend.handle_missing_translation/5 .","ref":"ElixirT1Web.Gettext.html#handle_missing_translation/5"},{"type":"module","title":"ElixirT1Web.Layouts","doc":"This module holds layouts and related functionality\nused by your application.","ref":"ElixirT1Web.Layouts.html"},{"type":"function","title":"ElixirT1Web.Layouts.app/1","doc":"Renders your app layout.\n\nThis function is typically invoked from every template,\nand it often contains your application menu, sidebar,\nor similar.","ref":"ElixirT1Web.Layouts.html#app/1"},{"type":"function","title":"Examples - ElixirT1Web.Layouts.app/1","doc":"Content","ref":"ElixirT1Web.Layouts.html#app/1-examples"},{"type":"function","title":"Attributes - ElixirT1Web.Layouts.app/1","doc":"* `flash` (`:map`) (required) - the map of flash messages.\n* `current_scope` (`:map`) - the current [scope](https://hexdocs.pm/phoenix/scopes.html). Defaults to `nil`.","ref":"ElixirT1Web.Layouts.html#app/1-attributes"},{"type":"function","title":"Slots - ElixirT1Web.Layouts.app/1","doc":"* `inner_block` (required)","ref":"ElixirT1Web.Layouts.html#app/1-slots"},{"type":"function","title":"ElixirT1Web.Layouts.flash_group/1","doc":"Shows the flash group with standard titles and content.","ref":"ElixirT1Web.Layouts.html#flash_group/1"},{"type":"function","title":"Examples - ElixirT1Web.Layouts.flash_group/1","doc":"<.flash_group flash={@flash} />","ref":"ElixirT1Web.Layouts.html#flash_group/1-examples"},{"type":"function","title":"Attributes - ElixirT1Web.Layouts.flash_group/1","doc":"* `flash` (`:map`) (required) - the map of flash messages.\n* `id` (`:string`) - the optional id of flash container. Defaults to `\"flash-group\"`.","ref":"ElixirT1Web.Layouts.html#flash_group/1-attributes"},{"type":"function","title":"ElixirT1Web.Layouts.root/1","doc":"","ref":"ElixirT1Web.Layouts.html#root/1"},{"type":"function","title":"ElixirT1Web.Layouts.theme_toggle/1","doc":"Provides dark vs light theme toggle based on themes defined in app.css.\n\nSee   in root.html.heex which applies the theme before page load.","ref":"ElixirT1Web.Layouts.html#theme_toggle/1"},{"type":"module","title":"ElixirT1Web.PageController","doc":"","ref":"ElixirT1Web.PageController.html"},{"type":"function","title":"ElixirT1Web.PageController.home/2","doc":"","ref":"ElixirT1Web.PageController.html#home/2"},{"type":"module","title":"ElixirT1Web.PageHTML","doc":"This module contains pages rendered by PageController.\n\nSee the `page_html` directory for all templates available.","ref":"ElixirT1Web.PageHTML.html"},{"type":"function","title":"ElixirT1Web.PageHTML.home/1","doc":"","ref":"ElixirT1Web.PageHTML.html#home/1"},{"type":"module","title":"ElixirT1Web.Router","doc":"","ref":"ElixirT1Web.Router.html"},{"type":"function","title":"ElixirT1Web.Router.api/2","doc":"","ref":"ElixirT1Web.Router.html#api/2"},{"type":"function","title":"ElixirT1Web.Router.browser/2","doc":"","ref":"ElixirT1Web.Router.html#browser/2"},{"type":"function","title":"ElixirT1Web.Router.call/2","doc":"Callback invoked by Plug on every request.","ref":"ElixirT1Web.Router.html#call/2"},{"type":"function","title":"ElixirT1Web.Router.formatted_routes/1","doc":"Callback implementation for  Phoenix.VerifiedRoutes.formatted_routes/1 .","ref":"ElixirT1Web.Router.html#formatted_routes/1"},{"type":"function","title":"ElixirT1Web.Router.init/1","doc":"Callback required by Plug that initializes the router\nfor serving web requests.","ref":"ElixirT1Web.Router.html#init/1"},{"type":"function","title":"ElixirT1Web.Router.verified_route?/2","doc":"Callback implementation for  Phoenix.VerifiedRoutes.verified_route?/2 .","ref":"ElixirT1Web.Router.html#verified_route?/2"},{"type":"module","title":"ElixirT1Web.Telemetry","doc":"","ref":"ElixirT1Web.Telemetry.html"},{"type":"function","title":"ElixirT1Web.Telemetry.child_spec/1","doc":"Returns a specification to start this module under a supervisor.\n\nSee `Supervisor`.","ref":"ElixirT1Web.Telemetry.html#child_spec/1"},{"type":"function","title":"ElixirT1Web.Telemetry.metrics/0","doc":"","ref":"ElixirT1Web.Telemetry.html#metrics/0"},{"type":"function","title":"ElixirT1Web.Telemetry.start_link/1","doc":"","ref":"ElixirT1Web.Telemetry.html#start_link/1"},{"type":"extras","title":"Introduction","doc":"# Introduction\n\nWelcome to the ElixirT1 documentation!\n\nThis project is a Phoenix application designed to demonstrate best practices and modern web development techniques with Elixir.","ref":"introduction.html"},{"type":"extras","title":"Getting Started - Introduction","doc":"To get started with the project, make sure you have Elixir and Erlang installed.\n\n1.  Clone the repository.\n2.  Run `mix setup` to install dependencies.\n3.  Start the server with `mix phx.server`.","ref":"introduction.html#getting-started"},{"type":"extras","title":"Features - Introduction","doc":"*   **Phoenix LiveView**: Real-time interactive UI without writing custom JavaScript.\n*   **Tailwind CSS**: Utility-first CSS framework for rapid UI development.\n*   **ExDoc**: Documentation generation for Elixir projects.","ref":"introduction.html#features"},{"type":"extras","title":"Contributing - Introduction","doc":"We welcome contributions! Please see the `CONTRIBUTING.md` file for more details.","ref":"introduction.html#contributing"}],"content_type":"text/markdown","proglang":"elixir","producer":{"name":"ex_doc","version":"0.39.1"}}